import React from 'react';

const NotificationCard = ({ isLoading, data }) => {
    return (
        <>
            <h1 className={"offset-xl-8 col-xl-1 text-xl-end"}>Notifications</h1>
            {isLoading ? (
                <span style={{top: '30%', left: '56%'}} className="loader"></span>
            ) : (
                data?.map((item, index) => (
                    <>

                        <div key={index} className="container" style={{backgroundColor: 'white'}}>
                            <div className={"col-xl-12"}>
                                <div className={"row"}>
                                    <div className={"col-xl-12"}>
                                        <h3>{item.userName} Liked article: {item.articleTitle}</h3>
                                    </div>
                                    <div className={"col-xl-4 mt-xl-5"}>
                                        <h5>{item.date}</h5>
                                    </div>
                                    <div className={"col-xl-4 mt-xl-5"}>
                                        <h6>{item.checked ? (<h1>Viewed</h1>) : (<h1>New</h1>)}</h6>
                                    </div>
                                </div>
                            </div>
                            <br/>
                        </div>
                        <br/>
                    </>
                ))
            )}
        </>
    );
};

export default NotificationCard;
